import  React from 'react';

function Mission(){
    return (
        <div className='Mission-container'>
            <h4>OUR MISSION</h4>
            <h1>Build the best tools possible to help you land the job of your dreams</h1>
            <p>Our guiding goal at Interview School is to help you progressively suck less at
               interviews. Using Interview School, you can be sure that interview preparation is out of
               sight, out of mind.
            </p>
        </div>
    )
};

export default Mission;
